import { useState } from "react";
import Link from 'next/link'

const Header = () => {
 

  return (
    <>
      
      <div className="AppBar">

      </div>
      <style>{`
        .AppBar {
            background: linear-gradient(45deg, blue, brown);
        }
        .form {
          display: flex;
          justify-content: center;
        }
        ul {
          width: 200px;
          margin: 10px auto;
        }
      `}</style>
    </>
  );
};

export default Header;
